import React from 'react';
import Header from './Header';
import FeedSection from './FeedSection';

function SocialFeedsPage() {
  return (
    <div className="App">
      <div className="bg-effects">
        <div className="bg-shape"></div>
        <div className="bg-shape"></div>
        <div className="bg-shape"></div>
        <div className="bg-shape"></div>
      </div>
      <Header />
      <main>
        <FeedSection />
      </main>
    </div>
  );
}

export default SocialFeedsPage;
